    return (
        <div>

            <HeaderArea>
               <div className="menu">

                    <div className="text">
                      <p>Sej√° Bem vindo</p>
                    </div>
                   <div className="menu--menu">
                        <Menu />
                   </div>
               </div>
            </HeaderArea>
        </div>
    );
}
